def load_model(ep):
    model_filename_dir = MODEL_SAVE_PB_EPOCH_PATH + "/ep" + str(ep)
    predict_fn = predictor.from_saved_model(model_filename_dir)
    return predict_fn


def predict(predict_fn, features):
    predictions = predict_fn(features)
    return predictions


